import React from 'react';
import { FaqQuestion } from './Faqapi';
import './Faq.css'
import { useState } from 'react';

const Faq = () => {
    const [data, setdata] = useState(FaqQuestion)
    return (
        <>
            {
                data.map((currElement)=>{
                 return currElement.id 
             })
            }
        </>
    )
}

export default Faq
